import { WebCustomControlCoverageHandler } from "./WebCustomControlCoverageHandler";
/**
 * Coverage handler for a label
 * Label is an interesting control - It is always part of another control and connected to it either through 'for' or as its parent
 */
export default class LabelWebControlCoverageHandler extends WebCustomControlCoverageHandler {
    type: string;
    startRecording(): boolean;
    areChildrenCapturable(): boolean;
    areChildrenRecordable(): boolean;
    isCapturable(): boolean;
    isRecordable(): boolean;
    isListenable(): boolean;
    updateElementRepositoryNode(elementNode: any): void;
    /**
     * This method gets our text as name for the control we label for.
     */
    getNameForPointed(): string;
    private getContentsText;
    private getId;
}
